(755, 140, 'right_content', '<h3>â€œFACE YOUR DREAMS.</h3>\r\n<h4>Beauty leads to a natural confidence which gives us courage\r\nto put our heart and soul into achieving our deepest desires\r\nand our most yearned for dreams.â€</h4>\r\nEvie â€“ brings out the best in every woman â€“ without changing who they are. Born\r\nfrom the unique, personal experiences of Natalie Wong â€“ chief inspiration officer of\r\nEvie, accidental entrepreneur, passionate motivator, unwavering optimist,\r\npersistent perfectionist, super-mom and more. For a decade, Natalie Wong enjoyed\r\nthe fruits of a fulfilling career in the corporate world of investment banking. Her\r\nendless ambitions, although rewarding â€“ eventually took a toll on her flawless skin.\r\nUnsatisfied with the products on the market, no matter how luxurious they\r\nappeared to be, she concocted her own skincare line â€“ first in her kitchen, and later\r\nin a leading laboratory. Armed with her innate instincts, creative and strategic\r\ntalents, and colored by her international experience â€“ her dream of enhancing\r\nbeauty in every woman was realized. Always believing in driving true results â€“ she\r\nwas able to fulfill a simple premise â€“ beauty always has a purpose.'),
